import React,{Component} from 'react';


class BillView extends Component
{
    render() {
        return(
            <div style={viewStyle}>
                <h2>Receipt</h2>
                <div>
                    <table>
                        <tbody>
                          <tr>
                              <td>From</td>
                          </tr>
                          <tr>
                              <td>To</td>
                          </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        );

    }
}
const viewStyle={
    textAlign:"center"
}
export default BillView
